import React from 'react';
import Box from '@mui/material/Box';

const CustomBox = ({ bgcolor, color, marginTop, marginBottom, children }) => {
  const boxStyles = {
    width: "100%",
    backgroundColor: bgcolor || '#36545d',
    color: color || 'white',
    marginTop: marginTop || 10,
    marginBottom: marginBottom || 3,
    borderRadius: '30px',
    overflow: 'hidden',
    padding: '35px',
    fontSize: '15px',
  };

  return (
    <Box sx={boxStyles}>
      {children}
    </Box>
  );
};

export default CustomBox;
